import React from 'react';
import { Button, View, } from 'react-native';

const Consolidacion = ({ navigation }) => {
    return (
        <View style={{
            flex: 1,
            alignItems: 'center',
            justifyContent: 'center'
        }}>
            <Button
                onPress={navigation.openDrawer}
                title="Open navigation drawer"
            />
        </View>
    );
}

export default Consolidacion
